import styles from "./LandingMain.module.scss";

import place from "../../media/about-company/25place.svg";
import team from "../../media/about-company/team.jpg";

export const LandingMain = () => {
    return (
        <>
            <div
                className={
                    styles.about_company + " container"
                }
            >
                <div className="container_1200"></div>
                <div className={styles.place_desc}>
                    <img src={place} alt="" />
                    <p>
                        в Республике Татарстан и в Приволжском федеральном
                        округе. По итогам 2020 года, компания вошла в топ
                        застройщиков по объему ввода жилья.
                    </p>
                </div>

                <div className={styles.team_prof}>
                    <div className={styles.desc}>
                        <h2>КОМАНДА ПРОФЕССИОНАЛОВ</h2>
                        <p>в Республике Татарстан и в Приволжском федеральном округе. По итогам 2020 года, компания вошла в топ застройщиков по объему ввода жилья.</p>
                        <a href="">Присоединиться</a>
                    </div>
                    <img src={team} alt="" />
                </div>
            </div>
        </>
    );
};
